import React from "react";

const NavHeader = () => {
  return (
    <div className="w-full h-auto mt-4">
      <ul className="flex justify-end space-x-8 mx-8 items-center">
        <li className="text-xs">Help</li>
        <li className="text-xs">Order & Returns</li>
        <li className="text-xs">Hi, Sanjay</li>
      </ul>
    </div>
  );
};

export default NavHeader;
